import todosReducers from './todosReducers'
import filtered from './filterReducer'
import { createSlice } from '@reduxjs/toolkit'

export const rootReducer = createSlice({
  name: 'rootReduce',
  initialState: localStorage.getItem('todos'),
  reducers: {
    todosReducers,
    filtered
  }

})
